import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
    },
    header: {
        fontWeight: 'bold',
        fontSize: 45,
        textAlign: 'center',
        color: '#e9c46a'
    },
});

export default styles;
